import React from "react";
import { stackList } from "../../data/ProjectData";
import {
  Image,
  Technologies,
  Tech,
  TechImg,
  TechName,
  ContactWrapper,
} from "./AboutElements";
function About() {
  return (
    <ContactWrapper id="about">
      <div className="Container">
        <div className="SectionTitle">About Me</div>
        <div className="BigCard">
          <Image
            src="https://raw.githubusercontent.com/gurupawar/website/main/src/Assets/man-svgrepo-com.svg"
            alt="man-svgrepo"
          />
          <div className="AboutBio">
            Hello! My name is <strong>Poojith Reddy</strong>, 
I have been working as a Teaching Assistant for University of Utah MSD program past one year for courses such as Introduction to Software Development, Computer Programming, Data Structures and Algorithms, Software Engineering. Also, I have 3 years of professional experience in Machine Learning and Data Science at Tata Consultancy Services Limited. Here, I worked on end-to-end implementation of Media Mix Modelling, ROI analysis and Customer Lifetime Value Model using Machine Learning for client Wiley, an American multinational publishing company. I have experience in architecting Artificial Intelligence applications with Machine Learning, Deep Learning, Natural Language Processing, Computer Vision using python and also have a great background in the deployment of Machine and Deep Learning models using Dockers and Kubernetes in cloud platforms like AWS, Azure. Built various Web applications and designed APIs using Flask, Django and also have in-depth knowledge in Exploratory Data Analysis, Data warehousing, ETL(Extract, Transform and Load) techniques and building reports according to Business needs using Tableau. I earned my bachelors degree from Indian Institute of Technology(IIT) Bhubaneswar in 2019.
          </div>
          <div className="AboutBio tagline2">
            I have become confident using the following technologies.
          </div>
          <Technologies>
            {stackList.map((stack, index) => (
              <Tech key={index} className="tech">
                <TechImg src={stack.img} alt={stack.name} />
                <TechName>{stack.name}</TechName>
              </Tech>
            ))}
          </Technologies>
        </div>
      </div>
    </ContactWrapper>
  );
}

export default About;
